measurements.description:
Ten flowers and six buds on three up to 12-cm inflorescences;
dorsal sepal ovate, white overlaid light green basally, horizontally barred lavender proximally some flowers;
lateral sepals white, overlaid light green, horizontal dark lavender bars;
petals ovate white overlaid light green;
lip spatulate, white, overlaid lavender centrally, stippled and spotted lavender distally;
column white, anther cap whiate;
substance firm; texture diamond dust.
